" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Distal radioulnar joint (DRUJ) compression test for DRUJ instability",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 430px; height: 437px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    To perform the DRUJ compression test, the examiner compresses the radial and ulnar heads together and then rotates the forearm. Pain with the maneuver suggests DRUJ instability, acute intraarticular injury, or arthritis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
