var title_f4_61_5084="Adverse effects of methotrexate";
var content_f4_61_5084=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F80229&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F80229&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Major adverse effects of methotrexate*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Bone marrow toxicity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neutropenia (most common, usually reversible)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thrombocytopenia (dose related, usually reversible)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anemia (rare)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Hepatic toxicity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cirrhosis &amp; fibrosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Pulmonary toxicity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Opportunistic infections",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        PCP, CMV, Herpes zoster, fungal, mycobacterial, etc",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Noninfectious conditions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Hypersensitivity pneumonitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Organizing pneumonia (previously called bronchiolitis obliterans with organizing pneumonia or BOOP)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Acute lung injury (noncardiogenic pulmonary edema)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Pulmonary fibrosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Asthma/hyperreactive airways disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Pleuritis and/or pleural effusion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Miscellaneous",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Oligospermia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Teratogenicity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Malignancy",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     PCP: Pneumocystis pneumonia; CMV: cytomegalovirus.",
"     <br/>",
"     * Major adverse effects are defined as potentially life-threatening (incidence &lt;1 percent) or requiring withdrawal of treatment (incidence 3 to 15 percent).",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
