"   <div class=\"lgnd\">",
"    Schematic model for the mechanism of action of steroid hormones, such as cortisol, aldosterone, and calcitriol. The hormone enters the cell by diffusion and combines with a specific receptor in the cytosol. The active hormone-receptor complex, which unmasks the DNA binding site on the receptor, then migrates to the nucleus where it interacts with specific genes, leading to RNA transcription and the eventual production of new proteins that are responsible for the physiologic actions of the hormone.",
